  }

  function afterOpenModal() {
    // references are now sync'd and can be accessed.
    subtitle.style.color = '#f00';
  }

  function closeModal() {
    setIsOpen(false);
  }
  return (
    <div className="App">
      <Header />
      <nav>
        <a>+ Create a Character</a>
      </nav>
    </div>
  );
}

export default App;
